How to exit a c program 2 answers
How can I terminate a C program in the following situations:
1. When a specific condition is met. For example, when a certain file is not found.
2. When a nested loop or recursive function is running.
3. When some kind of error is encountered.

Here are some possible ways to do this:

**1. When a specific condition is met.**
You can use the `exit()` function from the unistd.h library to terminate a program. The argument `status` is the status code that gets returned to the parent process or shell.
```c
#include <stdio.h>
#include <stdlib.h>
#include <unistd.h>

int main() {
    FILE *file = fopen("nonexistingfile", "r");
    if (file == NULL) {
        printf("File not found!\n");
        exit(1); // Terminate with status code 1
    }
   ... // rest of the program
    return 0;
}
```
